size = int(input('size: '))
sqlen = size**2

def getgrid(file):
	sudoku = open(file, "r")
	g = []
	for i in range(sqlen):
		a = []
		for j in range(sqlen+1):
			x = sudoku.readline(1)
			if (x[0] == 0):
				x = x.lstrip('0')
			if (str(x)!='\n'):
				x = x.rstrip('.')
				a.append(int(x))
		g.append(a)
	return g

