def eliminateallowedvalues(board):
	for i in range(sqlen):
		for j in range(sqlen):
			try:
				if (board[i][j] != 0):
					for k in range(sqlen):
						allowedvalues[i][j][k] = 0
			except:
				print(str(i)+" "+str(j))

def eliminatecolumnsandrows(board):
	for i in range(sqlen):
		for j in range(sqlen):
			for k in range(sqlen):
				for l in range(sqlen):
					if(board[i][l] == (k+1)):
						allowedvalues[i][j][k] = 0
			for k in range(sqlen):
				for l in range(sqlen):
					if(board[l][j] == (k+1)):
						allowedvalues[i][j][k] = 0

def eliminatebox(board):
	for i in range(sqlen):
		for j in range(sqlen):
			if(board[i][j] != 0):
				a = board[i][j] - 1
				for m in range(size):
					for n in range(size):
						allowedvalues[(m+i-(i%size))][(n+j-(j%size))][a] = 0

def placevalues(board):
	for i in range(sqlen):
		for j in range(sqlen):
			a = 0
			b = 0
			for k in range(sqlen):
				if(allowedvalues[i][j][k] != 0):
					a = a + 1
					b = k
			if (a == 1):
				board[i][j] = allowedvalues[i][j][b]
				allowedvalues[i][j][b] = 0

def checkdone():
	for i in range(sqlen):
		for j in range(sqlen):
			for k in range(sqlen):
				if(allowedvalues[i][j][k] != 0):
					return True
	return False

